          <div className="form__field">
            <input id="user-password-input" className="form__input form__input_role_user-password" type="text" name="user-password" value={userPassword || ''} onChange={handlePasswordChange} placeholder="Введите пароль" required />
            <span className="form__input-error user-password-input-error"></span>
          </div>
        </fieldset>
        <button className="form__submit button" type="submit" aria-label={buttonText}>{buttonText}</button>
      </form>
    </div>
  );
}

export default Login;
